import "./Card";

const Cardlist = (props) => {
  return (
    <div>
      <Card id={robots[0].id} title={robots[0].name} email={robots[0].email} />
      <Card id={robots[1].id} title={robots[0].name} email={robots[0].email} />
      <Card id={robots[2].id} title={robots[0].name} email={robots[0].email} />
    </div>
  );
};

export default Cardlist;
